import React from "react";
import "./Product.scss";
const productList = [
    {
        name: "Tran Minh Phu",
        age: 19
    },

    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },
    {
        name: "Tran Minh Phu",
        age: 19
    },

]
export const Product = () => {

    return <div className="Product d-flex">
        {productList.map((product) =>
            <div className="col-4 card">
                <h1>{product.name}</h1>
                <span>{product.age}</span>

                <button className="btn btn-primary">Show Detail</button>
            </div>
        )}
    </div>
}
